import React from 'react';
import {
	AiOutlineDelete,
	AiOutlinePlusCircle,
	AiOutlineMinusCircle,
} from 'react-icons/ai';
const CartRow = ({ item }) => {
	const { name, price, count, total } = item;
	return (
		<>
			<div className='col-2'>{name}</div>
			<div className='col-3'>{price}$</div>
			<div className='col-4'>
				<AiOutlinePlusCircle />
				{count}
			</div>

			<div className='col-5'>
				<AiOutlineDelete />
			</div>
			<div className='col-6'>{total}$</div>
		</>
	);
};

export default CartRow;
